First we determine the area of $\triangle ABC$.  We determine $BE$, the height of the triangle, by using the Pythagorean Theorem on right triangle $\triangle BAE$.  This gives \[BE=\sqrt{AB^2-AE^2}=\sqrt{5^2-3^2}=4.\]Thus,  \[[\triangle ABC] = \frac{1}{2}(BE)(AC)=\frac{1}{2}(4)(6)=12.\]Notice that we can compute the area of triangle $ABC$ in another way:  by using $\overline{BC}$ as the base (instead of $\overline{AC}$), and using $\overline{AD}$ as the altitude.  We know that $BC=5$ and $[\triangle ABC]=12$, so we have \[\frac{1}{2}(5)(AD)=12.\]Solving yields $AD=24/5$.

Now, we can compute $DC$ by using the Pythagorean Theorem on right triangle $\triangle ADC$: \[DC=\sqrt{AC^2-AD^2}=\sqrt{6^2-(24/5)^2}=18/5.\]With this value, we can compute the area of triangle $ADC$: \[[\triangle ADC]=\frac{1}{2}(AD)(DC)=\frac{1}{2}\left(\frac{24}{5}\right)\left(\frac{18}{5}\right)=\frac{216}{25}.\]Both triangle $DEA$ and triangle $DEC$ share the altitude from $D$ to $\overline{AC}$, and both triangles have equal base length.  Thus, triangles $\triangle DEA$ and $\triangle DEC$ have the same area.  Since \[[\triangle DEA]+[\triangle DEC]=[\triangle ADC],\]we conclude \[[\triangle DEC]=\frac{1}{2}\cdot \frac{216}{25}=\boxed{\frac{108}{25}}.\]

