Also, we know opposite sides of a parallelogram are congruent, so $AD = BC$.  Since $N$ is a midpoint of $\overline{BC}$, we have $CN = \dfrac{AD}2$.  By similar triangles, \[ \dfrac{AQ}{CQ} = \dfrac{AD}{CN} = 2, \]so $AQ = 2CQ.$  Since $AQ + CQ = AC = 15$, we have $CQ = 5$ and $AQ = \boxed{10}.$

Let $j$ be John's age and $d$ be his dad's age. We are trying to find the value of $d$. We can create a system of two equations to represent the given information. They are

\begin{align*}
j &= d - 31 \\
j + d &= 53 \\
\end{align*}

We want to find $d$, so we need to eliminate $j$ from the equations above. Substituting the first equation into the second to eliminate $j$, we have $(d-31)+d=53$, or $d=42$. Thus, John's dad is $\boxed{42}$ years old.

We are given that $r = \cos \theta + \sin \theta.$  Then
\[r^2 = r \cos \theta + r \sin \theta,\]so $x^2 + y^2 = x + y.$  We can write this equation as
\[\left( x - \frac{1}{2} \right)^2 + \left( y - \frac{1}{2} \right)^2 = \frac{1}{2}.\]Thus, the graph is a circle.  The answer is $\boxed{\text{(B)}}.$

[asy]
unitsize(2 cm);

pair moo (real t) {
  real r = cos(t) + sin(t);
  return (r*cos(t), r*sin(t));
}

path foo = moo(0);
real t;

for (t = 0; t <= pi + 0.1; t = t + 0.1) {
  foo = foo--moo(t);
}

draw(foo,red);

draw((-0.5,0)--(1.5,0));
draw((0,-0.5)--(0,1.5));
label("$r = \cos \theta + \sin \theta$", (2,1), red);
